import React from "react";
import Navbar from "../layouts/Navbar";

export default function Home() {
  return (
    <>
      <div className="flex flex-col lg:flex-row">
        <div>
          <Navbar />
        </div>
        <div className="bg-red-500">hello</div>
      </div>
    </>
  );
}
